) AS OTD ([OrderID],[OrderStatusCode],[OrderTransactionData],[IsComplete],[CreateDate],[CreateUser],[ModifyDate],[ModifyUser],[IsActive])

select * from Orders.OrderTransactionDetails

--Script to update all Fedex Links
select OrderTransactionID, OrderID, json_value(OrderTransactionData, '$[0].trackingUrl' ) as OldtrackingUrl, json_value(OrderTransactionData, '$[0].trackingNumber' ) as trackingNumber, 
('https://www.fedex.com/fedextrack/?trknbr='+json_value(OrderTransactionData, '$[0].trackingNumber' )) as NewtrackingURL, CreateDate

into #OrdertransactionDetails

from orders.OrdertransactionDetails 
where OrderTransactionData like '%http://www.fedex.com/Tracking?action=track%' 
and CreateUser like '%DeposcoUser%' order by OrderID desc

select count(*) as NoOfRows from #OrdertransactionDetails

update Orders.OrderTransactionDetails set OrderTransactionData = json_modify(O.OrderTransactionData,'$[0].trackingUrl', OT.NewtrackingURL)
from Orders.OrderTransactionDetails O, #OrdertransactionDetails OT
where O.OrderTransactionID = OT.OrderTransactionID and O.OrderID = OT.OrderID

